<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <style>
      body {
        width: 100vw;
        height: 100vh;
        position: relative;
        overflow: hidden;
      }
      * {
        border: none;
        margin: 0;
        padding: 0;
        -webkit-touch-callout: none;
        -webkit-user-select: none;
        -khtml-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        -webkit-tap-highlight-color: transparent;
      }
      .wrapper {
        width: 100%;
        height: 100%;
        background: #000;
        position: relative;
        display: flex;
        align-items: center;
        justify-content: center;
        overflow: hidden;
      }
      .head-txt {
        position: absolute;
        width: 100vw;
        top: -30vh;
        left: 50%;
        transform: translateX(-50%);
        z-index: 4;
      }
      .main-txt {
        position: absolute;
        left: 50%;
        transform: translateX(-50%);
        width: 100vw;
        top: -28px;
        z-index: 4;
      }
      .coins {
        position: absolute;
        top: 50%;
        transform: translateY(calc(-50% + 18px));
        width: calc(84%);
        z-index: 3;
        display: flex;
        flex-wrap: wrap;
      }
      .coin {
        position: relative;
        z-index: 9;
        width: 33.3%;
        cursor: pointer;
      }
      .opened {
        animation: blink 1.3s ease infinite;
      }
      .main-bg {
        position: absolute;
        width: 100vw;
        left: 0;
        z-index: 3;
      }
      .action-btn {
        position: absolute;
        z-index: 10;
        bottom: 15vh;
        display: none;
      }
      .active {
        display: block;
        cursor: pointer;
        animation: show 0.6s ease;
        width: 80%;
      }
      .active > .img {
        width: 100%;
      }
      .active .blink-1 {
        position: absolute;
        left: 0;
        animation: rounded-1 6s ease infinite;
      }
      .active .blink-2 {
        z-index: -1;
        position: absolute;
        animation: rounded-2 6s ease infinite;
      }
      .hide {
        display: none;
      }
      @keyframes show {
        0% {
          opacity: 0.6;
          width: 20%;
        }
        100% {
          opacity: 1;
          width: 80%;
        }
      }
      @keyframes rounded-1 {
        0% {
          top: -5px;
          left: -8px;
        }
        40% {
          top: -5px;
          left: calc(100% - 34px);
        }
        50% {
          top: calc(100% - 42px);
          left: calc(100% - 34px);
        }
        90% {
          top: calc(100% - 42px);
          left: -8px;
        }
        100% {
          top: -5px;
          left: -8px;
        }
      }
      @keyframes rounded-2 {
        0% {
          top: -40px;
          left: -40px;
        }
        40% {
          top: -40px;
          left: calc(100% - 84px);
        }
        50% {
          top: calc(100% - 92px);
          left: calc(100% - 84px);
        }
        90% {
          top: calc(100% - 92px);
          left: -40px;
        }
        100% {
          top: -40px;
          left: -40px;
        }
      }
      @keyframes blink {
        0% {
          box-shadow: 0 0 10px #ffd770;
        }
        50% {
          box-shadow: 0 0 80px #ffd770;
        }
        100% {
          box-shadow: 0 0 10px #ffd770;
        }
      }
      .finger {
        position: absolute;
        z-index: 99;
        animation: up-down 1.5s ease infinite;
      }
      .finger svg {
        width: 80px;
        height: 80px;
      }
      @keyframes up-down {
        0% {
          transform: translateY(50px);
        }
        50% {
          transform: translateY(0px);
        }
        100% {
          transform: translateY(50px);
        }
      }
    </style>
  </head>
